import { MinHeight } from '@interface/index';

export const getMinHeight = (minHeight: MinHeight) => {
    const styles = {};

    if (minHeight.base) {
      styles['--min-height-base'] = minHeight.base;
    }

    if (minHeight.sm) {
      styles['--min-height-sm'] = minHeight.sm;
    }

    if (minHeight.md) {
      styles['--min-height-md'] = minHeight.md;
    }

    if (minHeight.lg) {
      styles['--min-height-lg'] = minHeight.lg;
    }

    return styles;

}
